ScriptHook::ScriptHook(rage::joaat_t script_hash, std::unordered_map<scrNativeHash, scrNativeHandler> replacements) :
	m_ScriptHash(script_hash),
	m_NativeReplacementsPointer(std::move(replacements))
{
	Ensure();
}

ScriptHook::ScriptHook(rage::scrProgram* program, std::unordered_map<scrNativeHash, scrNativeHandler> replacements) :
	m_NativeReplacementsPointer(std::move(replacements))
{
	HookInstance(program);
}

ScriptHook::~ScriptHook()
{
	if (m_Program)
	{
		for (auto [hash, handler_ptr] : m_NativeHandlerPointer)
		{
			auto og_handler = g_GameVariables->m_GetNativeHandler(g_GameVariables->m_NativeRegistrationsPtr, hash);
			*handler_ptr = og_handler;
		}
	}

	if (m_VMTHook)
	{
		m_VMTHook->Disable();

		if (m_Program)
			s_Map.erase(m_Program);
	}
}

void ScriptHook::Ensure()
{
	if (m_VMTHook)
		return;

	if (auto program = g_GameVariables->m_ScriptProgramTable/*m_script_program_table*/->find_script(m_ScriptHash))//g_GameFunctions->m_ScriptProgramTable
	{
		if (program->is_valid())
		{
			HookInstance(program);
		}
		else
		{
			Log::Msg("Failed to hook: %s", program->m_name);
		}
		//else
			//g_Logger->Info(ConsoleColor::RED, "Error", "Failed to hook: %s", program->m_name);

	}
}

void ScriptHook::HookInstance(rage::scrProgram* program)
{
	m_Program = program;
	s_Map.emplace(m_Program, this);
	m_VMTHook = std::make_unique<VMTHook>((void***)m_Program, 3);
	m_VMTHook->Hook(&scrProgramDetour, 0);

	for (auto [replacement_hash, replacement_handler] : m_NativeReplacementsPointer)
	{
		auto hash = replacement_hash;
		ScriptHook::MapNative2(&hash);

		auto og_handler = g_GameVariables->m_GetNativeHandler(g_GameVariables->m_NativeRegistrationsPtr, hash);
		if (!og_handler)
			continue;

		auto handler_ptr = m_Program->get_address_of_native_entrypoint(og_handler);
		if (!handler_ptr)
			continue;

		m_NativeHandlerPointer.emplace(hash, reinterpret_cast<scrNativeHandler*>(handler_ptr));
		*handler_ptr = replacement_handler;
	}
}

void ScriptHook::scrProgramDetour(rage::scrProgram* this_, bool free_memory)
{
	if (auto it = s_Map.find(this_); it != s_Map.end())
	{
		auto hook = it->second;

		hook->m_Program = nullptr;
		s_Map.erase(it);

		auto og_func = hook->m_VMTHook->GetOriginal<decltype(&scrProgramDetour)>(0);
		hook->m_VMTHook->Disable();
		hook->m_VMTHook.reset();

		og_func(this_, free_memory);
	}
}

