native_hook::native_hook(rage::scrProgram* program, const std::unordered_map<int, scrNativeHandler>& native_replacements)
{
	hook_instance(program, native_replacements);
}


static inline bool m_are_handlers_cached{ false };
static inline scrNativeHandler m_handlers[g_crossmap.size()];

bool getcrossmap = 1;

void cache_handlers()
{
	if (m_are_handlers_cached)
		return;

	for (int i = 0; i < g_crossmap.size(); i++)
	{
		m_handlers[i] = g_GameVariables->m_GetNativeHandler(g_GameVariables->m_NativeRegistrationsPtr, g_crossmap[i]);
	}

	m_are_handlers_cached = true;
}

static scrNativeHandler* get_handlers()
{
	[[assume((cache_handlers(), m_are_handlers_cached == true))]]
	if (!m_are_handlers_cached) [[unlikely]]
		cache_handlers();

		return m_handlers;
}

void native_hook::hook_instance(rage::scrProgram* program, const std::unordered_map<int, scrNativeHandler>& native_replacements)
{
	m_program = program;
	m_vmt_hook = std::make_unique<vmt_hook>(m_program, 9);
	m_vmt_hook->hook(6, &scrprogram_dtor);
	m_vmt_hook->enable();

	m_handler_hook = std::make_unique<vmt_hook>(&m_program->m_native_entrypoints, m_program->m_native_count);
	m_handler_hook->enable();

	std::unordered_map<scrNativeHandler, scrNativeHandler> handler_replacements;

	for (auto& [replacement_index, replacement_handler] : native_replacements)
	{
		auto og_handler = get_handlers()[static_cast<int>(replacement_index)];
		handler_replacements[og_handler] = replacement_handler;
	}

	for (int i = 0; i < m_program->m_native_count; i++)
	{
		if (auto it = handler_replacements.find((scrNativeHandler)program->m_native_entrypoints[i]);
			it != handler_replacements.end())
		{
			m_handler_hook->hook(i, it->second);
		}
	}
}
